message:
Tenho contato com um assessor e amg prox do PR . Isso aqui foi o q ele mandou :

Tínhamos 3 generais que se apresentaram pra assumir a frente do que fosse necessário.

Infelizmente, 6 covardes correram do serviço.

Traidores da pátria :
- Gen Freire Gomes: ex-Cmt Ex - se acovardou. Está fugindo do país e irá morar em Barcelona, Espanha, na casa da filha ;
- Gen Stumpf: amigo do Secretário Geral do TSE (nome aceito pelo Xandão para ser o futuro Cmt EB). Será o Chefe da POUPEX, por isso que não queria briga.
- Gen Tomás: foi ajudante de ordem do FHC por 4 anos. Pediu ao FHC para ser o Cmt Ex;
- Gen Richard: tentou articular com os governadores do nordeste para ser o Cmt Ex;
- Gen Amin: tem as provas das fraudes das urnas (Ch do comando de defesa cibernética) e não fez nada ;
- Gen Soares : amiguinho do Stumpf. Esse tbm já tem um carguinho bizurado esperando por ele no governo.

Detalhe: Gen Freire Gomes está fugindo do país . Vai abandonar o Brasil e ir morar em Barcelona, Espanha, na casa da filha.

Esse é o resumo da ópera.

PR foi abandonado por 6 generais bundoes e vários brigadeiros covardes que não o apoiaram na hora que mais precisava...

Quando a gente vê o governo chinês defender o governo do Lula, é pq eles estão cumprindo certinho as diretrizes comunistas. #olavotemrazão 

#despertem #saiadahipnose #despertatuquedormes








@despertandoleoes

🙏CONFIRAM🙏

Porque do céu se manifesta a ira de Deus sobre toda a impiedade e injustiça dos homens, que detêm a verdade em injustiça.
Porquanto o que de Deus se pode conhecer neles se manifesta, porque Deus lho manifestou.
Porque as suas coisas invisíveis, desde a criação do mundo, tanto o seu eterno poder, como a sua divindade, se entendem, e claramente se vêem pelas coisas que estão criadas, para que eles fiquem inescusáveis;
Porquanto, tendo conhecido a Deus, não o glorificaram como Deus, nem lhe deram graças, antes em seus discursos se desvaneceram, e o seu coração insensato se obscureceu.
Dizendo-se sábios, tornaram-se loucos.
E mudaram a glória do Deus incorruptível em semelhança da imagem de homem corruptível, e de aves, e de quadrúpedes, e de répteis.
Por isso também Deus os entregou às concupiscências de seus corações, à imundícia, para desonrarem seus corpos entre si;
Pois mudaram a verdade de Deus em mentira, e honraram e serviram mais a criatura do que o Criador, que é bendito eternamente. Amém.
Por isso Deus os abandonou às paixões infames. Porque até as suas mulheres mudaram o uso natural, no contrário à natureza.
E, semelhantemente, também os homens, deixando o uso natural da mulher, se inflamaram em sua sensualidade uns para com os outros, homens com homens, cometendo torpeza e recebendo em si mesmos a recompensa que convinha ao seu erro.
E, como eles não se importaram de ter conhecimento de Deus, assim Deus os entregou a um sentimento perverso, para fazerem coisas que não convêm;
Estando cheios de toda a iniqüidade, fornicação, malícia, avareza, maldade; cheios de inveja, homicídio, contenda, engano, malignidade;
Sendo murmuradores, detratores, aborrecedores de Deus, injuriadores, soberbos, presunçosos, inventores de males, desobedientes aos pais e às mães;
Néscios, infiéis nos contratos, sem afeição natural, irreconciliáveis, sem misericórdia;
Os quais, conhecendo o juízo de Deus (que são dignos de morte os que tais coisas praticam), não somente as fazem, mas também consentem aos que as fazem.

Romanos 1:18-32

